const initialState = {
	projectlistTabledata: []
};

const reducer = (state = initialState, action = {}) => {
	switch (action.type) {
		case "PUSH PROJECTLIST DATA":
			console.log("hey am redux");
			console.log(action.data);
			return {
				projectlistTabledata: action.data
			};
			break;

		default:
			return state;
	}
};

export default reducer;
